import React from "react";
import logo from "../../logo.svg";

import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faCoffee } from "@fortawesome/free-solid-svg-icons";

const element = <FontAwesomeIcon icon={faCoffee} />;

const ContentApiDetails = ({ covidDetails, loadingIcon }) => {
  const { TotalPositive, TotalDeath, TotalRecovered } = covidDetails;
  return (
    <div>
      <ul>
        <li>{loadingIcon ? { element } : TotalPositive}</li>
        <li>{loadingIcon ? <h2>Loading....</h2> : TotalDeath}</li>
        <li>{loadingIcon ? <h2>Loading....</h2> : TotalRecovered}</li>
      </ul>
    </div>
  );
};

export default ContentApiDetails;
